import React, { Component } from 'react';
import * as ReactBoostrap from 'react-bootstrap';
import axios from 'axios'
import { connect } from 'react-redux'
import { url } from '../API.js';
import Button from 'react-bootstrap/Button'
import ButtonGroup from 'react-bootstrap/ButtonGroup'
export default class ListarAgenda extends Component {

  constructor() {
    super();
    this.state = {
      serviciosAgendados: [],
      log: "",
      mensaje: "",
      date: new Date(),
      tareas: [],
      estaCliqueado: false,
      estaIniciado:false,
      notificacion:{},

    }

  }
  irTareas = (serId) => {
    console.log(serId);
    axios.post(url + '/tareasagendadas/listasTareasServicio/?id=' + serId).then((resp) => {
      console.log(resp.data);
      this.setState({
        tareas: resp.data,
        estaCliqueado: true,
      });
    }).catch((error) => {
      console.log(error);
    }
    )
  }

  iniciarTarea = (tarId) => {
    console.log(tarId);
    axios.post(url + '/tareasagendadas/iniciarTarea/?id=' + tarId).then((resp) => {
      console.log(resp.data);
      this.setState({
//boolean esta iniciado
//al iniciar la tarea cambiar el estado al servicio a que esta en proceso
      });
    }).catch((error) => {
      console.log(error);
    }
    )
  }
  finalizarTarea = (tarId) => {
    console.log(tarId);
    axios.post(url + '/tareasagendadas/finalizarTarea/?id=' + tarId).then((resp) => {
      console.log(resp.data);
      this.setState({
//boolean esta finalizado
//y respuesta con la notificacion creada
//cambiar el estado en finalizado al servicioagendado
      });
    }).catch((error) => {
      console.log(error);
    }
    )
  }
  componentDidMount = () => {
    axios.get(url + '/servicioAgendado/listar').then((resp) => {
      console.log(resp.data);
      this.setState({
        serviciosAgendados: resp.data,
      });
    }).catch((error) => {
      console.log(error);
    }
    )
  };
  render() {
    return (
      <div>
        <h1 >Lista Agenda</h1>
        <ReactBoostrap.Table className="table " hover variant="light-dark">
          <thead>
            <th scope="col">Id</th >
            <th scope="col">Estado</th>
            <th scope="col">Fecha Elegida</th>
            <th scope="col">Fecha Registro</th>
            <th scope="col">Id Servicio</th>
            {/*  <th scope="col">Fecha Fin</th> */}
          </thead>
          <tbody>
            {
              this.state.serviciosAgendados.map(elemento => (
                <tr key={elemento.id} value={elemento} id={elemento.id}>
                  <td>{elemento.id}</td>
                  <td>{elemento.estado}</td>
                  <td>{elemento.fechaElegida.substring(0, [10])}</td>
                  <td>{elemento.fechaRegistro.substring(0, [10])}</td>
                  <td>{elemento.servicio.id}</td>
                  <td>
                    <ButtonGroup>
                      <Button className="button" onClick={this.irTareas.bind(this, elemento.id)}>Ver tareas</Button>
                    </ButtonGroup>
                  </td>
                </tr>

              ))
            }
            {this.state.estaCliqueado === true ?
              this.state.tareas.map(e => (
                
                <tr>
                  <td>{e.tarea.nombre}</td>
                  <td>{e.tarea.descripcion}</td>
                  <td>
                    <ButtonGroup>
                      <Button className="button" onClick={this.iniciarTarea.bind(this, e.tarea.id)}>Iniciar</Button>
                    </ButtonGroup>
                  </td>
                  <td>
                    <ButtonGroup>
                      <Button className="button" onClick={this.finalizarTarea.bind(this, e.tarea.id)}>Finalizar</Button>
                    </ButtonGroup>
                  </td>
                </tr>
              )) : null
            }
          </tbody>
        </ReactBoostrap.Table>

      </div>
    );

  }
}
